import React, { useState } from "react";
import { predictPremium } from "./api";

function Form({ setResult, setError }) {
  const [formData, setFormData] = useState({
    age: "",
    weight: "",
    height: "",
    income_lpa: "",
    smoker: "false",
    city: "",
    occupation: "retired",
  });

  const handleChange = (e) => {
    const { id, value } = e.target;
    setFormData({ ...formData, [id]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const payload = {
        age: parseInt(formData.age),
        weight: parseFloat(formData.weight),
        height: parseFloat(formData.height),
        income_lpa: parseFloat(formData.income_lpa),
        smoker: formData.smoker === "true",
        city: formData.city,
        occupation: formData.occupation,
      };

      const response = await predictPremium(payload);
      setResult(response.data.predicted_insurance_premium);
      setError("");
    } catch (error) {
      setResult(null);
      setError(error.response?.data?.error || "Something went wrong");
    }
  };

  return (
    <form
      onSubmit={handleSubmit}
      className="bg-white p-6 rounded-lg shadow-md w-full max-w-md mx-auto"
    >
      <h2 className="text-2xl font-bold mb-4 text-center text-blue-700">
        Insurance Premium Predictor
      </h2>

      <label>Age:</label>
      <input
        id="age"
        type="number"
        className="form-control w-full border p-2 mb-2 rounded"
        onChange={handleChange}
        required
      />

      <label>Weight (kg):</label>
      <input
        id="weight"
        type="number"
        className="form-control w-full border p-2 mb-2 rounded"
        onChange={handleChange}
        required
      />

      <label>Height (cm):</label>
      <input
        id="height"
        type="number"
        className="form-control w-full border p-2 mb-2 rounded"
        onChange={handleChange}
        required
      />

      <label>Income (LPA):</label>
      <input
        id="income_lpa"
        type="number"
        className="form-control w-full border p-2 mb-2 rounded"
        onChange={handleChange}
        required
      />

      <label>Smoker:</label>
      <select
        id="smoker"
        className="form-control w-full border p-2 mb-2 rounded"
        onChange={handleChange}
      >
        <option value="false">No</option>
        <option value="true">Yes</option>
      </select>

      <label>City:</label>
      <input
        id="city"
        type="text"
        className="form-control w-full border p-2 mb-2 rounded"
        onChange={handleChange}
        required
      />

      <label>Occupation:</label>
      <select
        id="occupation"
        className="form-control w-full border p-2 mb-4 rounded"
        onChange={handleChange}
      >
        <option value="retired">Retired</option>
        <option value="freelancer">Freelancer</option>
        <option value="student">Student</option>
        <option value="government_job">Government Job</option>
        <option value="business_owner">Business Owner</option>
        <option value="unemployed">Unemployed</option>
        <option value="private_job">Private Job</option>
      </select>

      <button
        type="submit"
        className="bg-blue-600 text-white p-2 rounded w-full hover:bg-blue-800 transition"
      >
        Predict
      </button>
    </form>
  );
}

export default Form;
